import React from "react";
import Layout from "./components/layout";
import Profile from "./components/profile";

function App() {
  return (
     <main>
        <Layout>
          <Profile />
          <div>Repositories</div>
          <div>Starred</div>
        </Layout>
      </main>
  );
}

export default App;
